webpackJsonp([99441979370922],{417:function(t,o){t.exports={data:{markdownRemark:{html:"<h1>HTML5</h1>\n<h2>WebStorage</h2>\n<p>Можно использовать sessionStorage и localStorage. </p>\n<p><strong>sessionStorage</strong> - уникален для хоста url. Хранится, пока не закроется вкладка.</p>\n<p><strong>localStorage</strong> - тоже ограничен хостом, но доступен из любой вкладки и не стирается при закрытии вкладки/браузера.</p>\n<p>WebStorage API поддерживает события, то есть можно подписаться на событие добавления или изменения информации в localStorage.</p>",frontmatter:{path:"/blog/html5-web-storage",title:"HTML5"}}},pathContext:{}}}});
